import React from 'react';
import { Box, Typography } from '@mui/material';

function EmailManagement() {
  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Email Management
      </Typography>
      <Typography>
        Email management features coming soon...
      </Typography>
    </Box>
  );
}

export default EmailManagement;
